import React from "react";
import "../index.css";
export default function Notes({ header, text, count }) {
  console.log(header);
  return (
    <div>
      {header.map((val, index) => (
        <p key={index} className="note">
          {"Header:" + val}
          <br></br>
        </p>
      ))}
    </div>
  );
}
